import React from "react";
import styled from "styled-components";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function SimilarProducts() {
  const [items, setItems] = useState([]);

  useEffect(() => {
    fetch("/data.json") // Adjust the path as needed
      .then((response) => response.json())
      .then((data) => {
        setItems(data.similarproducts);
      })

      .catch((error) => console.error("Error fetching data:", error));
  }, []);
  return (
    <>
      <Container>
        <TitleWrapper>
          <HeadIcon />
          <Heading>Similar Products</Heading>
        </TitleWrapper>
        <CardContainer>
          {items.map((item) => (
            <Card key={item.id}>
              <ImageWrapper to={`/product/${item.id}`}>
                <Image src={item.image} alt={item.title} />
              </ImageWrapper>
              <InfoWrapper>
                <TextWrapper>
                  <Title>{item.title}</Title>
                  <Explore>{item.brand}</Explore>
                </TextWrapper>
                <Button>
                  <Price>{item.price}</Price>
                </Button>
              </InfoWrapper>
            </Card>
          ))}
        </CardContainer>
      </Container>
    </>
  );
}
const Container = styled.div`
  width: 90%;
  margin: 0 auto;
  max-width: 1280px;
  padding-bottom: 60px;
`;

const TitleWrapper = styled.div`
  display: flex;
  align-items: center;
  gap: 15px;
  margin-bottom: 60px;
  @media (max-width: 680px) {
    margin-bottom: 0px;
  }
`;
const HeadIcon = styled.span`
  width: 6px;
  height: 30px;
  border-radius: 10px;
  background-color: #8a33fd;
`;
const Heading = styled.h3`
  font-size: 34px;
  font-weight: 600;
  line-height: 33.5px;
  letter-spacing: 0.02em;
  @media (max-width: 480px) {
    font-size: 28px;
  }
`;
const CardContainer = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
  gap: 40px;

  @media (max-width: 680px) {
    flex-wrap: wrap;
  }
`;

const Card = styled.div`
  font-size: 16px;
  font-weight: 600;
  line-height: 19.2px;
  color: #3c4242;
  @media (max-width: 480px) {
    width: calc(45% - 0px);
  }
  @media (max-width: 320px) {
    width: calc(43% - 0px);
  }
`;

const ImageWrapper = styled(Link)`
  width: 100%;
  text-decoration: none;
  display: inline-block;
  margin-bottom: 40px;
  transition: all 0.3s ease;
  &:hover {
    transform: scale(1.1); /* Zooms the wrapper */
  }
  @media (max-width: 768px) {
    margin-bottom: 20px;
  }
`;
const Image = styled.img`
  width: 100%;
  display: block;
  border-radius: 10px;
`;
const InfoWrapper = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: center;
  @media (min-width: 980px) {
    align-items: flex-start;
    font-size: 14px;
  }
  @media (max-width: 768px) {
    flex-direction: column;
    text-align: center;
  }
`;
const TextWrapper = styled.div``;
const Title = styled(Link)`
  display: inline-block;
  margin: 10px 0px;
  text-decoration: none;
  font-size: 16px;
  font-weight: 600;
  line-height: 19.2px;
  color: #3c4242;
  @media (max-width: 768px) {
    font-size: 14px;
    margin-top: 0;
  }
  @media (max-width: 480px) {
    margin: 0;
  }
  @media (max-width: 320px) {
    font-size: 14px;
  }
`;
const Explore = styled.p`
  margin-top: 0px;
  color: #807d7e;
  font-size: 16px;
  font-weight: 600;
  @media (max-width: 768px) {
    font-size: 12px;
  }
  @media (max-width: 480px) {
  }
`;
const Button = styled.button`
  padding: 0;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #f6f6f6;
  border: none;
  width: 82.31px;
  height: 36.58px;
  border-radius: 8px;
  cursor: pointer;
`;
const Price = styled.p`
  font-size: 14px;
  font-weight: 700;
  margin: 0px;
`;
export default SimilarProducts;
